    public boolean checkThePresenceList(List<List<Integer>> list, List<Integer> check){
        for(int i = 0;i<list.size();i++){
            int count =0;
            for(int j= 0;j<list.get(i).size();j++){
                for(int k=0;k<check.size();k++){
                    if(list.get(i).get(j) == check.get(k)){
                        count++;
                    }
                }
            }
            if(count >= check.size()){
                return true;
            }
        }
        return false;
    }
    public List<List<Integer>> threeSum(int[] nums) {
        List<List<Integer>> result = new ArrayList<>();
        Map<ArrayList<Integer>, Integer> map = new HashMap<>();
        for(int i =0;i<nums.length;i++){
            for(int j=0;j<nums.length;j++){
                if(i != j){
                    ArrayList<Integer> list = new ArrayList<>();
                    list.add(i);
                    list.add(j);
                    map.put(list, (nums[i]+nums[j]));
                }
            }
        }

        for(int i =0;i<nums.length;i++){
            for(Map.Entry<ArrayList<Integer>, Integer> entry: map.entrySet()){
                int remaining = 0 - entry.getValue();
                ArrayList<Integer> arr1 = entry.getKey();
                if(remaining == nums[i] && arr1.get(0) != i && arr1.get(1) != i){
                    ArrayList<Integer> list1 = new ArrayList<>();
                    list1.add(nums[arr1.get(0)]);
                    list1.add(nums[arr1.get(1)]);
                    list1.add(nums[i]);
                    if(!checkThePresenceList(result, list1)) {
                        result.add(list1);
                    }
                }
            }
        }
        return result;
    }
    public boolean isPalindrome(String s) {
        String str = new String();
        for(int i =0;i<s.length();i++){
            if((64 < s.charAt(i) && s.charAt(i) < 91) || (96 < s.charAt(i) && s.charAt(i) < 123) || (48 <= s.charAt(i) && s.charAt(i)<= 57)){
                str+=s.charAt(i);
            }
        }
        str = str.toLowerCase();
        if(str.length()%2 == 0){
            int len = str.length();
            for(int i=0, j=len-1;i<len/2 && j>=len/2;i++, j--){
                    if(str.charAt(i)!=str.charAt(j)){
                        return false;
                }
            }
        }else{
            int len = str.length();
            for(int i=0, j=len-1;i<len/2 && j>len/2;i++, j--){
                    if(str.charAt(i)!=str.charAt(j)){
                        return false;
                    }
            }
        }
        return true;
    }
    public boolean isAnagram(String s, String t) {
        Map<Character, Integer> map = new HashMap<>();
        Map<Character, Integer> map1 = new HashMap<>();
        for(int i = 0;i<s.length();i++){
            map.put(s.charAt(i), map.getOrDefault(s.charAt(i), 0)+1);
        }

        for(int i = 0;i<t.length();i++){
            map1.put(t.charAt(i), map1.getOrDefault(t.charAt(i), 0)+1);
        }

        if(map.size() != map1.size()){
            return false;
        }
        for(Map.Entry<Character, Integer> entry: map.entrySet()){
            Integer mapValue = entry.getValue();
            Integer map1Value = map1.get(entry.getKey());
            if(!mapValue.equals(map1Value)){
                return false;
            }
        }
        return true;
    }

    public int[] topKFrequent(int[] nums, int k) {
        ArrayList arr = new ArrayList<>();
        int result[] =new int[k];
        int j = 0;
        Map<Integer, Integer> map = new HashMap<>();
        for(int i = 0;i<nums.length;i++){
            map.put(nums[i], map.getOrDefault(nums[i], 0)+1);
        }
        for(Map.Entry<Integer, Integer> entry: map.entrySet()){
            arr.add(entry.getValue());
        }
        Collections.sort(arr);
        for(int i = arr.size() -1 ;i>=arr.size() - k;i--) {
            for (Map.Entry<Integer, Integer> entry : map.entrySet()) {
                if (entry.getValue().equals(arr.get(i))) {
                    result[j] = entry.getKey();
                    j++;
                }
            }
        }
        return result;
    }

    public String encode(List<String> strs) {
        String res = new String();
        for(int i=0;i<strs.size();i++){
            res += (strs.get(i) + "#");
        }
        return res;
    }

    public List<String> decode(String str) {
        String[] res = str.split("#");
        if(str.isEmpty()){
            List<String> rest =new ArrayList<String>();
            rest.add("");
            return rest;
        }
        List<String> result =new ArrayList<String>();
        for(int i=0;i<res.length;i++){
            result.add(res[i]);
        }
        return result;
    }

